
<!DOCTYPE html>
<html lang="es">
<head>
<meta charset="UTF-8">
<title>Certificado Verificado</title>
<meta name="viewport" content="width=device-width, initial-scale=1.0">
<style>
* {
    box-sizing: border-box;
}

body {
    background:#EDEDE6;
    padding:30px 10px;
    margin:0;
    font-family:Calibri, Arial, sans-serif;
}

.page {
    max-width:900px;
    margin:auto;
}

.header-box {
    background:#ffffff;
    border-radius:18px;
    padding:10px;
}

.header-box img {
    width:100%;
    display:block;
}

.date-line {
    margin-top:14px;
    padding-left:11px;
    font-size:11.5px;
    color:#707070;
    font-family:Arial;
}

.card-wrapper {
    margin-top:10px;
}

.card {
    position:relative;
    background:#ffffff;
    border-radius:18px;
    padding:24px 29px;
    text-align:center;
    transform:scale(0.93);
    transform-origin:top center;
}

.card::before {
    content:"";
    position:absolute;
    top:2px; left:2px; right:2px; bottom:2px;
    border-radius:16.5px;
    border:1px solid #EDEDED;
    pointer-events:none;
}

.check-icon {
    width:66px;
    height:66px;
    margin:0px auto 4px;
    display:block;
}

.title {
    font-size:19px;
    font-weight:bold;
    margin-bottom:14px;
    line-height:1.30;
}

.line {
    font-size:14.5px;
    line-height:1.02;
    margin-bottom:1px;
}

.label {
    font-weight:bold;
}
</style>
</head>
